import NavBar from "./NavBar";
import Cards from "./Cards";
import { experiences } from "./Experiences";

const ouput = experiences.map(experience => <Cards { ...experience }/>)

export default function App() {
  return (
    <div>
        <NavBar />
        <div className='experience-container'>
            { ouput }
        </div>
    </div>
  );
}
